var title_f8_62_9195="Appearance of infected burns";
var content_f8_62_9195=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F83411&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F83411&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Appearance of infected burns",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Organism type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Appearance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Staphylococcal infection",
"       </td>",
"       <td>",
"        &nbsp;Previously re-epithelialized areas \"melting away\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pseudomonas aeruginosa",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Blue-green&nbsp;(pyocyanin), fluorescent yellow-green (pyvoverdine) color and sweet smell",
"         </li>",
"         <li>",
"          Invasive pseudomonas appear purple, punched-out lesions in burns or donor sites",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Candida",
"       </td>",
"       <td>",
"        &nbsp;Small white pustules on the skin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Herpes simplex-1",
"       </td>",
"       <td>",
"        &nbsp;Punched-out holes in previously healed skin (2 to 3 mm in diameter)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
